import {IndividualCard,CardContainer} from "./styles";
function CardDisplay({ id,name,brand,price,rating}:any) {
    <CardContainer>

    return (
      
      <IndividualCard>       
        <h2>{id}</h2>
        <p>{name}</p>
        <p>{brand}</p>
        <p>{price}</p>
        <p>{rating}</p>
      </IndividualCard>
    );
    </CardContainer>
  }
  export default CardDisplay;
